import React from 'react'
import styled from 'styled-components'
import { Input } from 'antd'
const StyledInput = styled(Input)`
          border-style: solid !important;
          border-width: 0px 0px 1px 0px !important;
          border-color: black !important;
          box-shadow: none !important;
          border-right-style: unset !important;
          border-right-width: 0px !important
`
export default function SimpleInput(props) {
  const TestInput = React.forwardRef((props, ref) => (
    <SimpleInput ref={ref} {...props} className="FancyButton" />
  ));

  const Child = ({ setRef }) => <input type="text" ref={setRef} />;

  return (
    <div>
      {/* <StyledInput readOnly={props.readOnly} prefix={props.prefix} defaultValue={props.defaultValue} ref={ref} /> */}
      <Child setRef={props.ref} />
    </div>
  )
}
